import React, { useEffect, useState, useMemo } from "react";
import Table from "react-bootstrap/Table";
import axios from "axios";

export default function Tenantdata() {
    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(false);

  useEffect(() => {
    setLoading(true);
    axios.get("http://localhost:8000/tenantdata").then((response) => {
        setData(response.data);
        setLoading(false);
    });
  }, []);

  const tabledata = useMemo(
    () => [
      {
        // first group - Users
        Header: "Users",
        // group columns
        columns: [
          {
            Header: "Tenant ID",
            accessor: "id"
          },
          {
            Header: "Tenant",
            accessor: "tenant"
          },
          {
            Header: "Type",
            accessor: "type"
          },
          {
            Header: "User ID",
            accessor: "userid"
          }

        ]
      }
    ],
    []
  );

  return (
    <div className="App">
      <Table columns={tabledata} data={data} />
    </div>
  );
}
